“Скандинавия” - это сеть современных многопрофильных клиник в Санкт-Петербурге, которая видит своей миссией помогать пациенту приумножать здоровье эффективно и комфортно.

“Скандинавия - Личный кабинет” - это приложение, которое собирает всю информацию о вашем здоровье в одном месте. Теперь она всегда под рукой - удобно и просто:

- Результаты всех анализов и другой диагностики, заключения и назначения врачей;
- Мгновенная онлайн-запись на прием;
- Телемедицинские онлайн консультации с врачом;
- Информация о ближайших приемах и подготовке к ним;
- Медицинские карты родственников;
- Обратная связь.

Чтобы получить доступ к приложению обратитесь к администратору клиники с любым документом, удостоверяющем личность.

Все данные в приложении защищены

Эксклюзивные привилегии для участников программы лояльности «Моя Вита», быстрый доступ к поиску и заказу лекарств, косметики и товаров для здоровья в новом приложении «Аптека Вита».

Скачайте мобильное приложение «Аптека Вита» — с нами удобно и выгодно!

В приложении вы можете:
— быстро найти и купить любой из более 20 000 товаров;
— использовать персональные купоны, акции и спецпредложения;
— бронировать товар в аптеке или оформлять предзаказ со склада с транспортировкой в аптеку при необходимости;
— узнавать адрес и время работы ближайших аптек;
— оформлять самовывоз или доставку на дом*;
— смотреть историю заказов;
— добавлять товары в избранное;
— следить за начислениями и списаниями бонусов.

Инструкция к выгодным покупкам в аптеках «Вита»:
1. Установите бесплатно мобильное приложение аптеки и станьте участником программы лояльности «Моя Вита».
2. Закажите товары по выгодным акциям с виртуальной «Золотой картой».
3. Заберите заказ в аптеке или закажите доставку на дом*.

В приложении представлен широкий ассортимент товаров по направлениям:
— лекарственные препараты и БАДы;
— активная косметика;
— товары для красоты и здоровья;
— товары для мам и малышей;
— медицинские приборы;
— ортопедия.

Высокое качество товаров
Гарантируем качество, строго соблюдаем стандарты закупок, хранения и логистики товаров.

Круглосуточное обслуживание
Удобный и простой в использовании онлайн-сервис круглосуточного заказа медикаментов и других товаров для здоровья.

Способы доставки*
Доставляем заказы в любую из 2000 аптек или на дом в 40 регионах России.

Мы помогаем вам быть здоровыми, а значит, счастливыми!

* Наличие возможности доставки, а также перечень товаров, доступных к доставке на дом, зависят от выбранного города.

Заказывайте лекарства, витамины и БАД, товары для мам и детей, средства гигиены, лечебную косметику и зоотовары в приложении онлайн-аптеки ЕАПТЕКА.

Качество товаров гарантировано. Все товары сертифицированы, строго соблюдаются условия хранения и транспортировки, в том числе для термолабильных препаратов (требующих хранения в холодильнике).

В каталоге представлены разные товарные позиции:
- витамины;
- БАД;
- широкий спектр лекарственных препаратов;
- лечебная косметика;
- гигиенические товары;
- продукция для детей, беременных и кормящих;
- зоотовары.

Установите приложение и первыми узнавайте о наличии лекарств, акциях и выгодных предложениях. Заказывайте в любое время: чат с фармацевтом и оформление заказов работают круглосуточно.

Приложение ЕАПТЕКА: просто, удобно, выгодно.
- Скидки и акции на лекарства, медицинские товары и косметику;
- Удобный поиск: голосом, по штрихкоду, активному веществу или торговому наименованию препарата;
- Один логин для сайта и мобильного приложения: доступ в «Избранное», к истории покупок и статусу заказов с любого устройства;
- Подробные инструкции к препаратам;
- Уведомления об изменении статуса заказа;
- Возможность онлайн оплаты картой, а также оплата через Apple Pay и SberPay

ЕАПТЕКА: быстро, надежно, всегда рядом.
- Более 70 000 товаров для красоты и здоровья – самый широкий ассортимент на рынке;
- Более 1 000 пунктов самовывоза;
- Аптечная лицензия № ЛО-82-02-000978 от 09 декабря 2020 г.;
- Разрешение на осуществление розничной торговли лекарственными препаратами для медицинского применения дистанционным способом № ДТ-77-000252 от 11.11.2020 г.

Отзывы, замечания и пожелания по работе приложения присылайте на почту mobile@eapteka.ru.
